function checkRouteIntegrity() {
    var pointTestList = []
    pointList.forEach(point => {
        if (pointTestList.includes(point)) {
            alert("Route Data Error\nPoint " + point + " is declared more than once")
        }
        pointTestList.push(point)
        if (points[point].flankprotection) {
            if (points[point].flankprotection == point) {
                alert("Route Data Error\nPoint " + point + " has flank protection with itself")
            }
        }
        if (document.getElementById(points[point].screen)) {
            if(!document.getElementById(points[point].screen).getElementById(point + "n")) {
                alert("Route Data Error\nPoint " + point + "'s normal position could not be found in screen " + points[point].screen)
            }
            if(!document.getElementById(points[point].screen).getElementById(point + "d")) {
                alert("Route Data Error\nPoint " + point + "'s diverging position could not be found in screen " + points[point].screen)
            }
        } else {
            alert("Route Data Error\nPoint " + point + " is declared to be in screen " + points[point].screen + ". This screen doesn't exist.")
        }
    })
    blockList.forEach(block => {
        var blockTestList = []
        if (blockTestList.includes(block)) {
            alert("Route Data Error\nBlock " + block + " is declared more than once")
        }
        blockTestList.push(block)
        if (blocks[block].right == block) {
            alert("Route Data Error\nBlock " + block + " has right block declared the same as itself")
        } else if (blocks[block].left == block) {
            alert("Route Data Error\nBlock " + block + " has left block declared the same as itself")
        }
        if (!document.getElementById(blocks[block].screen).getElementById(block)) {
            alert("Route Data Error\nBlock " + block + " could not be found in screen " + blocks[block].screen)
        }
        if (document.getElementById(blocks[block].screen)) {
            if(!document.getElementById(blocks[block].screen).getElementById(block)) {
                alert("Route Data Error\nBlock " + block + " could not be found in screen " + blocks[block].screen)
            }
        } else {
            alert("Route Data Error\nBlock " + block + " is declared to be in screen " + blocks[block].screen + ". This screen doesn't exist.")
        }
        if (blocks[block].right != "end" && blocks[block].right != "") {
            if (Array.from(blocks[block].right)[0] == "b") {
                if (block != blocks[blocks[block].right].left) {
                    alert("Route Data Error\nBlock " + block + "'s right block is " + blocks[block].right + ". However, this block's left block is " + blocks[blocks[block].right].left)
                }
            } else if (Array.from(blocks[block].right)[0] == "p") {
                if (!(block == points[blocks[block].right].normalleft || block == points[blocks[block].right].divergingleft)) {
                    alert("Route Data Error\nBlock " + block + "'s right block is " + blocks[block].right + ". However, this point's diverging and normal left blocks are " + points[blocks[block].right].divergingleft + " " + points[blocks[block].right].normalleft)
                }
            }
        }
        if (blocks[block].left != "end" && blocks[block].left != "") {
            if (Array.from(blocks[block].left)[0] == "b") {
                if (block != blocks[blocks[block].left].right) {
                    alert("Route Data Error\nBlock " + block + "'s left block is " + blocks[block].left + ". However, this block's right block is " + blocks[blocks[block].left].right)
                }
            } else if (Array.from(blocks[block].left)[0] == "p") {
                if (!(block == points[blocks[block].left].normalright || block == points[blocks[block].left].divergingright)) {
                    alert("Route Data Error\nBlock " + block + "'s left block is " + blocks[block].left + ". However, this point's diverging and normal right blocks are " + points[blocks[block].left].divergingright + " " + points[blocks[block].left].normalright)
                }
            }
        }
    })
    signalList.forEach(signal => {
        var signalTestList = []
        if (signalTestList.includes(signal)) {
            alert("Route Data Error\nSignal " + signal + " is declared more than once")
        }
        signalTestList.push(signal)
        if (document.getElementById(signals[signal].screen)) {
            if (!document.getElementById(signals[signal].screen).getElementById(signal)) {
                alert("Route Data Error\nSignal " + signal + " could not be found in screen " + signals[signal].screen)
            }
        } else {
            alert("Route Data Error\nSignal " + signal + " is declared to be in screen " + signals[signal].screen + ". This screen doesn't exist.")
        }
    })
    automaticSignalList.forEach(signal => {
        if (signals[signal]) {
            if (!signals[signal].automaticto) {
                alert("Route Data Error\nSignal " + signal + " is declared to be in automatic mode but it doesn't have an automatic destination.")
            }
        } else {
            alert("Route Data Error\nSignal " + signal + " is declared to be in automatic mode but this signal doesn't exist.")
        }
    });
}